result:
.routeinstall{
  width: 100%;
  height: calc(100vh - 80px);
  padding: 15px;
  background: #f0f3ff;
  overflow: hidden;
  position:relative;
}
.map_box{
  width: calc(100% - 345px);
  height: calc(100% - 30px);
  z-index: 10;
  position:absolute;
  right: 15px;
}
.scroll_box{
  width: 300px;
  height: calc(100% - 30px);
  background: #fff;
  position:absolute;
  left: 15px;
  top: 15px;
  z-index: 10;
  overflow-x: hidden;
}
.scroll_box>div{
  overflow-x: auto;
  width: 100%;
  height: 80%;
}
.scroll_box>div::-webkit-scrollbar {
  width : 1px;
  height: 1px;
}
#scroll{
  height: 100%;
  padding-top: 5%;
  padding-bottom: 5%;
  margin: auto;
}
.row1{
  width: 100%;
  height: 2vh;
  line-height: 2vh;
  font-size: 1.5vh;
  overflow: hidden;
}
.row2{
  width: 40%;
  float: left;
}
.scroll_box .leftdiv{
  margin-left:-45px;
}
.leftdiv_list {
  width: 80%;
  margin: auto;
  margin-top: 20px;
  padding-left:10px;
  font-size: 1.2vh;
  overflow: hidden;
  /* height: 7vh; */
  line-height: 5vh;
  cursor: pointer;
  position:relative;
}
.leftdiv_list .elselect {
  float: right;
  width: 70%;
}
.leftdiv_list table {
  background: #eff1f2;
}
.leftdiv_list tr {
  background: #fff;
}
.leftdiv_list th {
  background: #eff1f2;
}
.leftdiv_list td,
th {
  width: 33%;
  text-align: center;
  margin: 0;
  border-top: 1px solid #EFF1F2;
  border-left: 1px solid #EFF1F2;
  border-right: 1px solid #EFF1F2;
  /* border:  */
}
.leftdiv_list .el-input--medium {
  width: 70%;
  height: 50%;
  font-size: 10px;
  float: right;
}
.el-input__inner {
  height: 100%;
  width: 100%;
}
.leftdiv_list .datainp {
  width: 100%;
  height: 100%;
  border: 0;
}
.img_bg_box{
  position:absolute;
  top: 4px;
  left: 85px;
  list-style: none;
  padding: 0;
  margin: 0;
  text-align: center;
  height:17px;
  display: flex;
  justify-content: flex-start;
  flex-flow: row nowrap;
  width: 160px;
  height: 20px;
}
.img_bg_box li{
  padding: 0;
  margin: 0;
  width: 19px;
  height: 19px;
  display: inline-block;
  margin-left: 20px;
  text-align: center;
  line-height: 19px;
}
.img_bg_box li:hover{
  background: #A5A2A2;
}
.tank{
  width: 100px;
  height: 50px;
  background: #fff
}
.el-select .el-input .el-select__caret {
    line-height: 10px;
}
.title_name{
  font-size: 16px;
  font-weight: 800;
  color: #201F32;
  position: relative;
}
.star{
  position: absolute;
  top: 2px;
  left: 2px;
  color:#F54658;
}
.names_type{
  display: inline-block;
  font-size: 14px;
  font-weight: 600;
  margin-left: 20px;
}
.bianshan{
  color: blue;
  cursor: pointer;
}
